import "./App.css";
import Logo from "./componentes/Logo/index";
import perfil from "./img/perfil.svg";
import bag from "./img/sacola.svg";
import OptionHeader from "./componentes/optionHeader"; // Certifique-se de usar maiúsculas para componentes personalizados

const icons = [perfil, bag];

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Logo />
        <OptionHeader></OptionHeader>

        <ul className="icon">
          {icons.map((icon) => (
            <li className="icon-li">
              <img src={icon} alt="icon" />
            </li>
          ))}
        </ul>
      </header>
    </div>
  );
}

export default App;
